function ExpenseDate() {
    let month = props.date.toLocaleString('en-US', { month: 'long' });
    let day = props.date.toLocaleString('en-US', { day: '2-digit' });
    let year = props.date.getFullYear();
    return (
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
        </div>
    )
}
export default ExpenseDate;
